import Grid from "@material-ui/core/Grid";
import Box from "@material-ui/core/Box";
import Typography from "@material-ui/core/Typography";
import React from "react";

function CompFormSummarize(props) {
    return (
        <Grid container>

            <Grid item xs={12}>
                <Box mt={2}>
                    <Typography>
                        Цена: ${props.price}
                    </Typography>
                    <Typography>
                        Текущий баланс: {props.userBalance} $
                    </Typography>
                </Box>
            </Grid>

        </Grid>
    )
}

export default CompFormSummarize
